import Head from 'next/head';
import Navebar from '../components/navebar';

const Layout =(props) =>(
<div>
    <Head>
        <title>DMProfile!</title>
        <link rel="stylesheet" href="../js/bootstrap.min.css"/>
    </Head>
    <Navebar />
{props.children}
</div>
);

export default Layout;
